    }, []);


    // console.log(localStorage.getItem('labas'))

    return (
        <form>
            <label>Prekė
                <input type="text" name="fItem" />
            </label>
            <label>Kiekis
                <input type="number" name="fQty" />
            </label>
            <button >Pridėti</button>
        </form>
    );
}
export default Adds;
